import defaultImg from "../images/default-img1.png"
import defaultAvarta from "../images/default-avatar.png"

export const DefaultImg = (e) => {
    e.currentTarget.src = defaultImg;
};

export const DefaultPfofile = (e) => {
    e.currentTarget.src = defaultAvarta;
};
